import { Get_All_Setting } from "./Socket/SettingSocket"
import {Force_Logout, Start_With_Token } from "./Socket/UserSocket"
import {GridDebug ,ConsoleDebug} from "./devComponent"
import {useStore,useEffectV2,useSelector,Guest,memo,Game, } from "./importAll"

const App = memo(()=>{
    let store       = useStore()
    let allStore    = useSelector<any,any>(store=>store)
    let mainPage    = useSelector<any,any>(store=>store.mainPage)

    useEffectV2("app",()=>{
        Start_With_Token(store);
        Force_Logout(store);
        Get_All_Setting(store)
    })

    return(
        <>
            {mainPage=="Guest"? <Guest/> :"" }
            {mainPage=="Game" ? <Game/>   :"" }
            <ConsoleDebug allStore={allStore}/>
            <GridDebug />
        </>
    )
})
export default App
